　清潔できめの細かい高品質ウールマットの6枚入りです。<br>浮遊するゴミを効率よく濾し取る前処理濾材の基本。清潔できめの細かい高品質ウールマットの6枚入りです。【材質】ポリエステル【原産国または製造地】日本【諸注意】燃えやすいので火元の近くには置かないでください。目詰まりを起こすとポンプが止まったり、水があふれたりします。まめに点検してください。<br><br><br>■商品詳細<br><table width=630 border=1 cellspacing=0><tr><td bgcolor=#ffffcc><p style=margin:10px;>メーカー名：株式会社 スドー<br>商品サイズ：120×390×110mm<br><br>購入単位：1個<br>配送種別：在庫品</p></td></tr></table><br><br><table width=600 border=0 cellspacing=0><tr><td><font size=1>【検索用キーワード】<br>楽天 通販 スドー ろ材 お買い得 ウールマット 水質浄化</font></td></tr></table><style type="text/css">
